import React from 'react';
import './Header.css';

const Header = () => {
    return (
        <div>
        <header>
            <div className='name'>
            <h1>Vijaya Lakshmi</h1>
            <h2>Vardineedi</h2>
            </div>
            <nav>
                <ul>
                    <li><a href="#about">About Me</a></li>
                    <li><a href="#projects">Projects</a></li>
                    <li><a href="#contact">Contact</a></li>
                </ul>
            </nav>
        </header>
        </div>
    );
};

export default Header;
